import React from 'react'
import classes from './Messages.module.css'
import {NavLink} from 'react-router-dom'

const DialogItem = () => {
    return (
        <div>
            <NavLink></NavLink>
        </div>
    );
}

const Messages = () => {
    return (
        <div>
            <DialogItem id='1' name='Anton' />
        </div>
    );
}

const Mesage = () => {
    return (
        <div>
            <Message message="Hello" />
            <Message message="Yappi" />
            <Message message="YO" />
            <Message message="Ho" />
        </div>
    );
}

export default Messages
